syntax = "proto3";

package vmic.other;

option java_package = "com.vivo.iai.proto.feature.featureshop.user.history.other";
option java_outer_classname = "InstalledAndUnInstalledAppPro";

message InstalledAndUnInstalledApp{
    repeated string installed_apps = 1;
    repeated string unInstalled_apps = 2;
}

message InstalledAndUnInstalledAppFeature {
    InstalledAndUnInstalledApp installed_and_uninstalled_app_list = 1;
}
